import './App.css';
import Welcome from './componet/welcome/Welcome';
import PartySize from './componet/partySize/PartySize';
import Phone from './componet/phone/Phone'
import {Router , Route ,Link} from 'react-router-dom' 
function App() {
  return (
    <div>

      <Router>
        <Route pathName="/welcome" componet={Welcome}></Route>
        <Route pathName="/partySize" componet={PartySize}></Route>
        <Route pathName="/Phone" componet={Phone}></Route>
      </Router>
    </div>
  );
}

export default App;
